1. Local Variables:
Local variables are declared within a function or a block of code. They are created when the function or block is executed and destroyed when the function or block is exited. Local variables are not accessible outside of their defining function or block.

2. Static Variables:
Static variables are similar to local variables, but they are not destroyed when the function or block is exited. Instead, they retain their value between function calls. If a static variable is declared inside a function, it is initialized only once, the first time the function is called. If a static variable is declared outside a function, it is initialized only once, when the program starts.

3. Global Variables:
Global variables are declared outside of any function. They are accessible from any part of the program. Global variables are created when the program starts and destroyed when the program ends.

